import "./_chorwacja.scss";


const Chorwacja = () => {

    return (

        <div className="carousel-container ">
            <div className="opening_container container">
                <div className="opening_left">
                    <h1 className="opening_header">Chorwacja 08-09.2022</h1>
                    <h3 className="opening_text">
                        Nasz długo wyczekiwany wyjazd do Chorwacji w końcu 
                    </h3>
                </div>

            </div>
        </div>
    );
};

export default Chorwacja;
